async function applyDataTemplate(json){let mainElement=await document.querySelector("main");let tempNewCategoryBool=false;let tempNewSecondaryContainer=false;json.forEach(obj=>{switch(obj["content_level"]){case 1:let cvCategory=document.createElement("div");cvCategory.className+="cv-category home-section shadow-section";let cvCategoryTitle=document.createElement("h2");cvCategoryTitle.className+="cv-category-title";cvCategoryTitle.innerText=obj["content"];cvCategory.append(cvCategoryTitle);mainElement.append(cvCategory);if(!tempNewCategoryBool)tempNewCategoryBool=!tempNewCategoryBool;break;case 2:if(tempNewCategoryBool){let contentContainerElement=document.createElement("ul");contentContainerElement.className+="cv-content-container";(async()=>{let lastCVCategory=await mainElement.querySelector(".cv-category:last-child");lastCVCategory.append(contentContainerElement)})();tempNewCategoryBool=!tempNewCategoryBool}let contentElement=document.createElement("li");contentElement.className+="cv-content key";contentElement.innerText=obj["content"];(async()=>{let lastCVCategory=await mainElement.querySelector(".cv-category:last-child");let lastCVContentContainer=await lastCVCategory.querySelector(".cv-content-container:last-child");lastCVContentContainer.append(contentElement)})();if(!tempNewSecondaryContainer)tempNewSecondaryContainer=!tempNewSecondaryContainer;break;case 3:if(tempNewSecondaryContainer){let secondaryContentContainerLi=document.createElement("li");secondaryContentContainerLi.className+="cv-content-secondary-container";let secondaryContentContainerUl=document.createElement("ul");(async()=>{let lastCVCategory=await mainElement.querySelector(".cv-category:last-child");let lastCVContentContainer=await lastCVCategory.querySelector(".cv-content-container:last-child");secondaryContentContainerLi.append(secondaryContentContainerUl);lastCVContentContainer.append(secondaryContentContainerLi)})();tempNewSecondaryContainer=!tempNewSecondaryContainer}let contentSecondaryElement=document.createElement("li");contentSecondaryElement.className+="cv-content-secondary key";contentSecondaryElement.innerText=obj["content"];(async()=>{let lastCVCategory=await mainElement.querySelector(".cv-category:last-child");let lastCVContentContainer=await lastCVCategory.querySelector(".cv-content-container:last-child");let lastCVContentSecondaryContainer=await lastCVContentContainer.querySelector(".cv-content-secondary-container:last-child");let lastCVContentSecondaryContainerUl=await lastCVContentSecondaryContainer.querySelector("ul");lastCVContentSecondaryContainerUl.append(contentSecondaryElement)})()}})}async function cvDataFetch(){const res=await fetch("/cv/data");if(res.ok){let json=await res.json();await applyDataTemplate(json)}else{console.error("HTTP-Error: "+res.status)}}cvDataFetch().then(r=>{if(r)console.log(r)});